import React from 'react';

const About = () => {
  return (
    <p>This page has been developed with ReactJs for frontend and Python for backend. The page is about animals information which is retrieved from WWF website and internet by default. The images are credited for WWF website by default as well. The idea is that users can upload, share the information of their favourite animals. Besides, they can sell the picture, toys relating to the animal (e-commerce). </p>
  );
};

export default About;
